import React from "react";

// reactstrap components
import {
  Container, Row,Button
} from "reactstrap";

// core components

function Laws() {
  return (
    <>

      <Container>
            <div className="row mainheading">
              <div className="col md-4"><hr className="home-border"/></div>
              <div  className=" col md-4 home1"> <h6 className="home"><span> LAWS </span></h6></div>
              <div className="col md-4" ><hr className="home-border"/></div>
            </div>
            </Container>
            <Container>
              <Row><Button style={{backgroundColor:'#FFBE14',borderColor:'white'}}>Get More Info</Button></Row>
            </Container>


    </>
  );
}

export default Laws;
